import React from "react";
import "../Stylesheets/Projects.css";
import { projects } from "../constants";
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineDot,
  TimelineOppositeContent,
} from "@mui/lab";
import { Button } from "@mui/material";

export default function Projects({ projectsRef }) {
  return (
    <>
      <div className="projects" ref={projectsRef}>
        <div className="projects header">Featured Projects:</div>
        <div
          className="timeline-container"
          style={{ display: "flex", justifyContent: "center" }}
        >
          <div className="timeline">
            <Timeline position="left">
              {projects.map((project, index) => {
                return (
                  <TimelineItem key={index}>
                    <TimelineOppositeContent>
                      <div className="project-container flex flex-col m-auto max-w-[450px] rounded-[14px] p-6 content-center bg-white gap-3">
                        <img
                          className="rounded-lg"
                          src={project.img}
                          alt={project.alt}
                        />
                        <span className="project-title font-bold text-md">
                          {project.name}
                        </span>
                        <span className="project-description text-sm">
                          {project.description}
                        </span>
                        <p className="project-tech text-xs flex flex-row content-between">
                          {project.stack}
                        </p>
                        <Button className="project-link">View More</Button>
                      </div>
                    </TimelineOppositeContent>
                    <TimelineSeparator>
                      <TimelineDot />
                      <TimelineConnector />
                    </TimelineSeparator>
                    <TimelineContent>
                      <span>Hey</span>
                    </TimelineContent>
                  </TimelineItem>
                );
              })}
            </Timeline>
          </div>
        </div>
      </div>
    </>
  );
}
